export function getHeigtdataFromImage(t,e,a){let r=document.createElement("canvas");r.width=e,r.height=a;let n=r.getContext("2d"),o=e*a,g=new Float32Array(o);n.drawImage(t,0,0);for(let t=0;t<o;t++)g[t]=0;let l=n.getImageData(0,0,e,a).data,d=0;for(let t=0,e=l.length;t<e;t+=4){let e=l[t]+l[t+1]+l[t+2];g[d++]=e/3}return g}export function toDegrees(t){return t*(180/Math.PI)}export function toRadians(t){return t*(Math.PI/180)}